import React, { Component } from "react";
import style from "./DisplaySeat.module.css";

export default class DisplaySeat extends Component {
  render() {
    return (
      <React.Fragment>
        <h3
          className={`text-uppercase font-weight-bold ${style["text-yellow"]}`}
        >
          Đặt vé xem phim cyberclearnarn.vn
        </h3>
        <div className="display-seat">
          <div
            className={`${style["display-seat__monitor"]} text-white font-weight-bold`}
          >
            <h5>Màn hình</h5>
          </div>
          <div className="display-seat__seats">
            <Seat />
          </div>
        </div>
      </React.Fragment>
    );
  }
}
